function getTimeText(date){
  if(date.toString().length == 10){
    date = date * 1000
  }
  date = parseInt(date)
  const nowDate = new Date()
  const dealDate = new Date(date)
  const differ = nowDate.getTime() - date
  const days = differ / (24 * 60 * 60 * 1000)
  if(days < 1 && nowDate.getDate() == dealDate.getDate()){
    return Format.date(date,'HH:mm')
  }

  const dayDiffer = parseInt(nowDate.getTime()/24/60/60/1000) - parseInt(dealDate.getTime()/24/60/60/1000)

  return dayDiffer + '天前'
}

function getScroll(w, top) {
  var ret = w['page' + (top ? 'Y' : 'X') + 'Offset'];
  var method = 'scroll' + (top ? 'Top' : 'Left');
  if (typeof ret !== 'number') {
   var d = w.document;
   // ie6,7,8 standard mode
   ret = d.documentElement[method];
   if (typeof ret !== 'number') {
     // quirks mode
     ret = d.body[method];
   }
  }
  return ret
}

