class HomeSecondScreen extends Component {
  constructor(props){
    super(props)
    const scrollTop = getScroll(window,true)
    this.state = {
      topBarIndex: 2,
      typeBarIndex: 1,
      listData: [],
      pagination: {
        currentPage: 1,
        pageSize: 8,
        totalPages: 2
      },
      dialog:{
        open: false,
        title: '',
        content: '',
        handleClose:null
      },
      playScale: scrollTop >= 1388 ? 0.8 : 0.2
    }
  }

  componentDidMount(){
    this.fetchList()
  }

  fetchList(){
    const url = this.state.topBarIndex == 1 ? Api.pb.getRealNiuBility : Api.pb.getSimNiuBility
    const pagination = this.state.pagination
    ApiCaller.call(url,{
      page: pagination.currentPage,
      pageSize: pagination.pageSize,
      type: this.state.typeBarIndex
    },(res) => {
      if(res.code == 0){
        const state = this.state
        state.listData = []
        state.listData.push(res.data)
        state.pagination.currentPage = res.currentPage
        state.pagination.totalPages = res.totalPages
        this.setState(state)
        // 预先加载前后两页
        this.fetchBeforeList()
        this.fetchAfterList()
      }
    })
  }

  fetchBeforeList(){
    const url = this.state.topBarIndex == 1 ? Api.pb.getRealNiuBility : Api.pb.getSimNiuBility
    const pagination = this.state.pagination
    if(pagination.currentPage <= 1){
      return
    }
    ApiCaller.call(url,{
      page: pagination.currentPage - 1,
      pageSize: pagination.pageSize,
      type: this.state.typeBarIndex
    },(res) => {
      if(res.code == 0){
        const state = this.state
        state.listData.unshift(res.data)
        this.setState(state)
      }
    })
  }

  fetchAfterList(){
    const url = this.state.topBarIndex == 1 ? Api.pb.getRealNiuBility : Api.pb.getSimNiuBility
    const pagination = this.state.pagination
    // 是否为最后一页
    if(pagination.currentPage == pagination.totalPages){
      return
    }
    // 是否已经加载过
    if(this.state.listData.length >= pagination.currentPage + 1){
      return
    }
    ApiCaller.call(url,{
      page: pagination.currentPage + 1,
      pageSize: pagination.pageSize,
      type: this.state.typeBarIndex
    },(res) => {
      if(res.code == 0){
        const state = this.state
        state.listData.push(res.data)
        this.setState(state)
      }
    })
  }

  handleTopBarSwitch(index){
    const state = this.state
    if(state.topBarIndex == index){
      return
    }
    state.topBarIndex = index
    state.pagination.currentPage = 1
    state.pagination.totalPages = 2
    this.setState(state)
    this.fetchList()
  }

  handleTypeBarSwitch(index){
    const state = this.state
    if(state.typeBarIndex == index){
      return
    }
    state.typeBarIndex = index
    state.pagination.currentPage = 1
    state.pagination.totalPages = 2
    this.setState(state)
    this.fetchList()
  }

  getEnterAnim(e){
    const index = e.index;
    const delay = index % 4 * 100 + Math.floor(index / 4) * 100 + 300;
    return { y: '+=30', opacity: 0, type: 'from', delay };
  }

  handleSwitchPanel(index){
    const state = this.state
    state.pagination.currentPage += index
    this.setState(state)
    // 前一页
    if(index == -1){
      //this.fetchBeforeList()
    }else if(index == 1){
      this.fetchAfterList()
    }
  }

  ShowDialog(para={}){
    const state = this.state
    state.dialog = {
      open:true,
      title:para.title || '',
      content:para.content || '',
      handleClose:() => {
        this.setState({ dialog:{ open:false } })
      }
    }
    this.setState(state)
  }

  handleLookOn(item){
    if(!Cookie.get('sid',{ path:'/' })){
      location.href = "//user." + Runtime.getDomain() + '/login.html?url=' + location.href
      return
    }
    ApiCaller.call(Api.pb.inviterLookOn,{
      uid: Cookie.get('uid',{ path:'/' }),
      lookUid: item.uid,
      status: item.lookStatus == 1 ? -1 : 1
    },(res) => {
      if(res.code == 0){
        const state = this.state
        for(var i = 0;i < state.listData.length;i ++){
          for(var j = 0;j < state.listData[i].length;j ++){
            if(state.listData[i][j].uid == item.uid){
              state.listData[i][j].lookStatus *= -1
              state.listData[i][j].visible = true
              this.setState(state)
              this.reSetMessageAnimate(i,j)
              return
            }
          }
        }
      }else if(res.code == 5000){
        location.href = "//user." + Runtime.getDomain() + '/login.html?url=' + location.href
      }
    })
  }

  reSetMessageAnimate(i,j){
    const timer = setTimeout(() => {
      const state = this.state
      state.listData[i][j].visible = false
      this.setState(state)
    },2000)
  }

  handleShowProfile(item){
    location.href="//pb." + Runtime.getDomain() + '/sim/profile/' + item.uid
  }

  getItemHtml(data){
    const typeBarIndex = this.state.typeBarIndex
    const html = (data || []).map((_item,_index) => {
      const _html = (_item || []).map((item,index) => {
        return (
          <div className="item" key={index} onClick={() => {  }}>
            <div className="info">
              <img src={item.headImage} onClick={this.handleShowProfile.bind(this,item)}/>
              <div className="detail">
                <a onClick={this.handleShowProfile.bind(this,item)}>{item.userName}</a>
                <span>最近发布时间：{getTimeText(item.timeStamp)}</span>
              </div>
            </div>
            <div className="content">
              <div className={typeBarIndex == 1 ? "left-value max" : "left-value"}>
                <p>{(item.profitRate/8).toFixed(2)}%</p>
                <span>30天收益率</span>
              </div>
              <div className={typeBarIndex == 2 ? "left-value max" : "left-value"}>
                <p>{item.successRate}%</p>
                <span>30天胜率</span>
              </div>
            </div>
            <div className="foot">
              <span className={typeBarIndex == 3 ? "max" : ""}>{item.popularity}</span>
              <div>人气</div>
              <div className={ item.visible ? "show-qipao show" : "show-qipao" }>{item.lookStatus == 1 ? "已加入观察" : "已取消观察"}</div>
              <i className={item.lookStatus == 1 ? "iconfont icon-shoucangshixin" : "iconfont icon-shoucang"} onClick={this.handleLookOn.bind(this,item)}/>
            </div>
          </div>
        )
      })
      // 偏移位置
      const left = 1210 * (_index)
      return (
        <TweenOneGroup
          className='sec-content clearfix'
          component="div"
          enter={this.getEnterAnim.bind(this)}
          leave={{ y: '+=30', opacity: 0 }}
          key={_index}
          style={{ left:left }}
        >
          { _html }
        </TweenOneGroup>
      )
    })
    return html
  }

  render(){
    // 顶部实盘/模拟tab切换动画设置
    const topBarIndex = this.state.topBarIndex
    const topBarLeft = (topBarIndex - 1) * 70
    // 类型切换动画设置
    const typeBarIndex = this.state.typeBarIndex
    const typeBarLeft = (typeBarIndex - 1) * 140 + 15
    // 分页切换动画设置
    const pagination = this.state.pagination
    const currentPage = this.state.pagination.currentPage
    const pageLeft = -1 * (currentPage - 1) * 1210
    // 内容
    const html = this.getItemHtml(this.state.listData)
    // 左右箭头样式
    const iconLeftClass = classnames({
      "left-arrow": true,
      "hide": currentPage == 1
    })
    const iconRightClass = classnames({
      "right-arrow": true,
      "hide": currentPage == this.state.pagination.totalPages
    })
    return (
      <div className="home-second-screen">
        <OverPack
          replay={false}
          always={false}
          className="over-pack layout clearfix"
          style={{ width:1220 }}
          component="div"
          playScale={getScroll(window,true) >= 900 ? 0.8 : 0.2}
          hideProps={{ title: { reverse: true }, type: { reverse: true }}}
        >
          <TweenOne
            animation={{ y: '+=30', opacity: 0, type: 'from' }}
            component="div"
            key="title"
            className="header-bar"
            style={{ width:1200,margin:'50px auto 0' }}
            reverseDelay={300}
          >
            <span>最牛金顾</span>
            <div>
              <span className={ topBarIndex == 1 ? "active hide" : "hide" } onClick={this.handleTopBarSwitch.bind(this,1)}>实盘</span>
              <span className={ topBarIndex == 2 ? " red-background" : "" } onClick={this.handleTopBarSwitch.bind(this,2)}>模拟</span>
              <i className="hide" style={{ left:0 }}/>
            </div>
            <div className="type-bar clearfix">
              <span className={ typeBarIndex == 1 ? "active" : "" } onClick={this.handleTypeBarSwitch.bind(this,1)}>最赚钱</span>
              <span className={ typeBarIndex == 2 ? "active" : "" } onClick={this.handleTypeBarSwitch.bind(this,2)}>最稳健</span>
              <span className={ typeBarIndex == 3 ? "active" : "" } onClick={this.handleTypeBarSwitch.bind(this,3)} style={{ border:0,margin:0 }}>最人气</span>
              <i style={{ left:typeBarLeft }}/>
            </div>
          </TweenOne>
          <div className="layout overflow" style={{ width:1220,padding:'0 10px',position:'relative' }}>
            <div className="sec-content-container" style={{ marginLeft:pageLeft }}>
              {html}
            </div>
          </div>

        </OverPack>
        <TweenOne
          animation={{ x: '-=20', yoyo: true, repeat: -1, duration: 1000 }}
          className={iconLeftClass}
          key="iconL"
          onClick={this.handleSwitchPanel.bind(this,-1)}
        >
          <Icon type="left" />
        </TweenOne>
        <TweenOne
          animation={{ x: '+=20', yoyo: true, repeat: -1, duration: 1000 }}
          className={iconRightClass}
          key="iconR"
          onClick={this.handleSwitchPanel.bind(this,1)}
        >
          <Icon type="right" />
        </TweenOne>
        <div className="link-dots" id="homePage2"/>
        <Dialog {...this.state.dialog}/>

      </div>
    )
  }
}

class HomeThirdScreen extends Component {
  constructor(props){
    super(props)
    this.state = {
      topBarIndex: 2,
      buyListData: [],
      profitListData: [],
      isTradeTime: false,
      stockNowPrice: {},
      buyListOnLoading: false,
      profitListOnLoading: false,
      scroll: {
        top: 0,
        reTop: 6,
        _top: 0,
        _reTop: 6
      },
      buyListScrollFlag: true,
      profitScrollFlag: true
    }
    this.stockPriceInterve = null
    this.timerIsTradeTime = null
    this.listInterve = null
  }

  componentDidMount(){
    // 买入列表
    this.fetchBuyList()
    // 盈利列表
    this.fetchProfitList()
    // 获取股票单价
    //this.getStockInfo()
    // 判断交易日
    //this.fetchTradeDay()
    // 滚动显示数据
    this.setScrollList()
  }

  componentWillUnmount(){
    clearInterval(this.stockPriceInterve)
    clearTimeout(this.timerIsTradeTime)
    clearInterval(this.listInterve)
  }

  fetchBuyList(){
    this.setState({ buyListOnLoading:true })
    const url = this.state.topBarIndex == 1 ? Api.pb.getRealBuyAndProfit : Api.pb.getSimBuyAndProfit
    ApiCaller.call(url,{
      page: 1,
      pageSize: 20,
      type: 1
    },(res) => {
      const state = this.state
      state.buyListOnLoading = false
      if(res.code == 0){
        state.buyListData = res.data
      }
      this.setState(state)
    })
  }

  fetchProfitList(){
    this.setState({ profitListOnLoading:true })
    const url = this.state.topBarIndex == 1 ? Api.pb.getRealBuyAndProfit : Api.pb.getSimBuyAndProfit
    ApiCaller.call(url,{
      page: 1,
      pageSize: 20,
      type: 2
    },(res) => {
      const state = this.state
      state.profitListOnLoading = false
      if(res.code == 0){
        state.profitListData = res.data
      }
      this.setState(state)
    })
  }

  fetchTradeDay () {
    // 如果非调试模式
    if (!Cookie.get('debug')) {
      ApiCaller.call(Api.home.isTradeDay, (res)=>{
        if (res.code == 0) {
          if (res.data.flag == 1) {
            // 启动定时器判断时间
            this.timerTradeTime()
          }
        }
      })
    } else {
      this.setTradeTime(true)
    }
  }

  timerTradeTime(){
    const value = TradeUtil.isTradeTime()
    this.setTradeTime(value)

    this.timerIsTradeTime = setTimeout(()=>{
      this.timerTradeTime()
    }, 1000);
  }

  setTradeTime(value){
    const state = this.state
    state.isTradeTime = value
    this.setState(state)
  }

  getStockInfo(){
    this.stockPriceInterve = setInterval(() => {
      const stockListArray = []
      const stockObj = {}
      const stockList = this.state.buyListData
      for(var i in stockList){
        const item = stockList[i]
        stockListArray.push(item.stockFullCode)
        stockObj[item.stockFullCode] = 1
      }
      // 获取单价
      for(var index = 0; index < stockListArray.length; index ++){
        ApiCaller.callStockInfo(stockListArray[index],(resStock) => {
          const state = this.state
          const stockFullCode = resStock.data[0].stockFullCode
          state.stockNowPrice[stockFullCode] = resStock.data[0].nowPrice
          this.setState(state)
        })
      }
      // 非交易日，只获取一遍
      const isTradeTime = this.state.isTradeTime
      if(!isTradeTime){
        clearInterval(this.stockPriceInterve)
        return
      }
    },3000)
  }

  setScrollList(){
    const handleScroll = this.handleScroll.bind(this)
    const handleScrollRight = this.handleScrollRight.bind(this)
    this.listInterve = setInterval(() => {
      handleScroll()
      handleScrollRight()
    },2000)
  }

  handleScroll(){
    const state = this.state
    if(state.buyListData.length <= 6 || !state.buyListScrollFlag){
      return
    }
    if(state.scroll.top <= 0){
      state.scroll.top += -1
      state.scroll.reTop = state.scroll.top + state.buyListData.length
      if(state.scroll.reTop == -1){
        // 替换
        state.scroll.top = state.scroll.reTop + state.buyListData.length
      }
    }else if(state.scroll.reTop <= 0){
      state.scroll.reTop += -1
      state.scroll.top = state.scroll.reTop + state.buyListData.length
      if(state.scroll.top == -1){
        // 替换
        state.scroll.reTop = state.scroll.top + state.buyListData.length
      }
    }
    this.setState(state)
  }

  handleScrollRight(){
    const state = this.state
    if(state.profitListData.length <= 6 || !state.profitScrollFlag){
      return
    }
    if(state.scroll._top <= 0){
      state.scroll._top += -1
      state.scroll._reTop = state.scroll._top + state.profitListData.length
      if(state.scroll._reTop == -1){
        // 替换
        state.scroll._top = state.scroll._reTop + state.profitListData.length
      }
    }else if(state.scroll._reTop <= 0){
      state.scroll._reTop += -1
      state.scroll._top = state.scroll._reTop + state.profitListData.length
      if(state.scroll._top == -1){
        // 替换
        state.scroll._reTop = state.scroll._top + state.profitListData.length
      }
    }
    this.setState(state)
  }

  handleTopBarSwitch(index){
    const state = this.state
    if(state.topBarIndex == index){
      return
    }
    state.topBarIndex = index
    this.setState(state)
    // 买入列表
    this.fetchBuyList()
    // 盈利列表
    this.fetchProfitList()
  }

  getEnterAnim(e){
    const index = e.index;
    const delay = index % 4 * 100 + Math.floor(index / 4) * 100 + 300;
    return { y: '+=30', opacity: 0, type: 'from', delay };
  }

  handleBuyOnMouseOver(e){
    const state = this.state
    state.buyListScrollFlag = false
    this.setState(state)
  }

  handleBuyOnMouseOut(e){
    const state = this.state
    state.buyListScrollFlag = true
    this.setState(state)
  }

  handleProfitOnMouseOver(e){
    const state = this.state
    state.profitScrollFlag = false
    this.setState(state)
  }

  handleProfitOnMouseOut(e){
    const state = this.state
    state.profitScrollFlag = true
    this.setState(state)
  }

  render(){
    // 顶部实盘/模拟tab切换动画设置
    const topBarIndex = this.state.topBarIndex
    const topBarLeft = (topBarIndex - 1) * 70
    // 最近买入列表
    const buyHtml = this.state.buyListData.map((item,index) => {
      const nowPrice = this.state.stockNowPrice[item.stockFullCode]
      const percent = nowPrice ? parseInt(((nowPrice - item.averagePrice) / item.averagePrice) * 100) : '--'
      return (
        <li key={index} onMouseOver={this.handleBuyOnMouseOver.bind(this)} onMouseOut={this.handleBuyOnMouseOut.bind(this)}>
          <div className="column" style={{ width:160 }}>
            <div className="title">{item.userName}</div>
            <div className="value">{getTimeText(item.createTimeStamp)} 发布</div>
          </div>
          <div className="column" style={{ width:150 }}>
            <div className="title" style={{ color:'#bb7708' }}>{item.stockName}</div>
            <div className="value">{item.hangQuantity}股</div>
          </div>
          <div className="column" style={{ width:150,position:'relative' }}>
            <div className="title">买入：{item.averagePrice}</div>
            <div className="value">止盈：{item.stopProfit}</div>
            <div className={percent < 0 ? "profit loss hide" : "profit hide"}>
              <i className={percent < 0 ? "iconfont icon-down" : "iconfont icon-top"}/>
              <span>{percent}%</span>
            </div>
          </div>
          <div className="column">
            <a className="btn" href={"//pb." + Runtime.getDomain() + '/real/trade/buy/t1?code=' + item.stockFullCode}>跟买</a>
          </div>
        </li>
      )
    })
    // 最近盈利
    const profitHtml = this.state.profitListData.map((item,index) => {
      const percent = parseInt((item.soldPrice - item.buyPrice) / item.buyPrice * 100)
      return (
        <li key={index} onMouseOver={this.handleProfitOnMouseOver.bind(this)} onMouseOut={this.handleProfitOnMouseOut.bind(this)}>
          <div className="column" style={{ width:160 }}>
            <div className="title">{item.userName}</div>
            <div className="value">{getTimeText(item.soldTimeStamp)} 发布</div>
          </div>
          <div className="column" style={{ width:150 }}>
            <div className="title">{item.stockName}</div>
            <div className="value">{item.soldQuantity}股</div>
          </div>
          <div className="column" style={{ width:150,position:'relative' }}>
            <div className={item.dmProfitLoss < 0 ? "title color-green" : "title color-red"}>{Format.fixed(item.dmProfitLoss || 0)}</div>
            <div className="value">盈利分配</div>
            <div className={percent < 0 ? "profit loss hide" : "profit hide"}>
              <i className={percent < 0 ? "iconfont icon-down" : "iconfont icon-top"}/>
              <span>{percent}%</span>
            </div>
          </div>
          <div className="column">
            <a className="btn" href={"//pb." + Runtime.getDomain() + '/real/trade/buy/t1?code=' + item.stockFullCode}>跟买</a>
          </div>
        </li>
      )
    })
    return(
      <div className="home-third-screen" component="div">
        <OverPack
          replay={false}
          always={false}
          className="over-pack layout overflow"
          component="div"
          playScale={[0.2,0.8]}
          hideProps={{ title: { reverse: true }, type: { reverse: true }}}
        >
          <TweenOne
            animation={{ y: '+=30', opacity: 0, type: 'from' }}
            component="div"
            key="title"
            className="header-bar"
            reverseDelay={300}
          >
            <span>今日动态</span>
            <div>
              <span className={ topBarIndex == 1 ? "active hide" : "hide" } onClick={this.handleTopBarSwitch.bind(this,1)}>实盘</span>
              <span className={ topBarIndex == 2 ? " red-background" : "" } onClick={this.handleTopBarSwitch.bind(this,2)} >模拟</span>
              <i className="hide" style={{ left:0 }}/>
            </div>
          </TweenOne>
          <div className="content-left">
            <div className="header">最近买入</div>
            <div className="content">
              <TweenOneGroup
                className='list'
                component="ul"
                enter={this.getEnterAnim.bind(this)}
                leave={{ y: '+=30', opacity: 0 }}
                style={{ top:this.state.scroll.top * 90,display:this.state.scroll.reTop == -1 ? 'none' : 'block' }}
              >
                {buyHtml}
                <li className={this.state.buyListData == 0 && !this.state.buyListOnLoading ? "empty" : "hide"}>暂无数据</li>
              </TweenOneGroup>
              <TweenOneGroup
                className='list'
                component="ul"
                enter={this.getEnterAnim.bind(this)}
                leave={{ y: '+=30', opacity: 0 }}
                style={{ top:this.state.scroll.reTop * 90,display:this.state.scroll.top == -1 ? 'none' : 'block' }}
              >
                {buyHtml}
                <li className={this.state.buyListData == 0 && !this.state.buyListOnLoading ? "empty" : "hide"}>暂无数据</li>
              </TweenOneGroup>
            </div>
          </div>
          <div className="content-right">
            <div className="header">最近获利</div>
            <div className="content">
              <TweenOneGroup
                className='list'
                component="ul"
                enter={this.getEnterAnim.bind(this)}
                leave={{ y: '+=30', opacity: 0 }}
                style={{ top:this.state.scroll._top * 90,display:this.state.scroll._reTop == -1 ? 'none' : 'block' }}
              >
                {profitHtml}
                <li className={this.state.profitListData == 0 && !this.state.profitListOnLoading ? "empty" : "hide"}>暂无数据</li>
              </TweenOneGroup>
              <TweenOneGroup
                className='list'
                component="ul"
                enter={this.getEnterAnim.bind(this)}
                leave={{ y: '+=30', opacity: 0 }}
                style={{ top:this.state.scroll._reTop * 90,display:this.state.scroll._top == -1 ? 'none' : 'block' }}
              >
                {profitHtml}
                <li className={this.state.profitListData == 0 && !this.state.profitListOnLoading ? "empty" : "hide"}>暂无数据</li>
              </TweenOneGroup>
            </div>
          </div>
        </OverPack>
        <div className="link-dots" id="homePage3"/>

      </div>
    )
  }
}

