class Home extends Component {
  constructor(props){
    super(props)
    this.state = {
      bannerTabIndex: 1,
      sideBar: {
        position: 'fixed',
        top: '50%',
        backTopVisible: false
      },

    }
    this.scrollTimer = null
    this.scrollTopTarget = 0
    this.scrollAllowError = 5
  }

  componentDidMount(){
    this.onScrollHandle()
  }

  onScrollHandle(){
    window.addEventListener('scroll', (e) => {
      const scrollTop = parseInt(getScroll(window, true))
      const state = this.state
      if (scrollTop > 712){
        state.sideBar = {
          position: 'fixed',
          top: '50%',
          backTopVisible: true
        }
      }else{
        state.sideBar = {
          position: 'fixed',
          top: '50%',
          backTopVisible: false
        }
      }
      this.setState(state)
    })
  }

  onChangeTab(index){
    if (index == 2404) {
      this.context.router.push('/help/register')
      return
    }
    const scrollTop = parseInt(getScroll(window,true))
    this.scrollTopTarget = index
    this.handleBodyScroll()
    return false
  }

  handleBodyScroll(){
    this.scrollTimer = setInterval(() => {
      const scrollTop = parseInt(getScroll(window,true))
      if(this.validateScrollBarPosition(scrollTop)){
        this.scrollTopMove(this.scrollTopTarget)
        clearInterval(this.scrollTimer)
        return
      }
      const step = (this.scrollTopTarget - scrollTop) / 6
      this.scrollTopMove(getScroll(window,true) + step)
      document.body.scrollTop += step
    },20)
  }

  validateScrollBarPosition(scrollTop){
    if(Math.abs(this.scrollTopTarget - scrollTop) <= this.scrollAllowError){
      return true
    }
    if(Math.abs(scrollTop + document.body.clientHeight - document.body.scrollHeight) <= this.scrollAllowError){
      return true
    }
    return false
  }

  scrollTopMove(top){
    document.body.scrollTop = document.documentElement.scrollTop = top
  }

  handleOnCloseHot(){
    const state = this.state

    this.setState(state)
  }

  render(){
    return(
      <div className="home">
        <SideBar {...this.state.sideBar}/>
        <HomeBanner
          {...this.props}
          tabIndex={this.state.bannerTabIndex}
          onChangeTab={this.onChangeTab.bind(this)}/>
        <HomeSecondScreen {...this.props}/>
        <HomeThirdScreen {...this.props}/>
        <HomeFourthScreen/>
        <HomeFivethScreen/>

      </div>
    )
  }
}

Home.contextTypes = {
  router: React.PropTypes.object.isRequired
}

export default connect(state => ({
  global: state.global,
  user: state.user
}), dispath => ({
  actions: bindActionCreators(Actions, dispath)
}))(Home)

module.exports = exports['default']
